  - - 1
    - Chicken
    - "The chicken is a type of domesticated fowl, a subspecies of the red junglefowl
      (Gallus gallus). It is one of the most common and widespread domestic animals,
      with a total population of more than 19 billion as of 2011. There are more chickens
      in the world than any other bird or domesticated fowl. Humans keep chickens
      primarily as a source of food (consuming both their meat and eggs) and, less
      commonly, as pets. Originally raised for cockfighting or for special ceremonies,
      chickens were not kept for food until the Hellenistic period (4th–2nd centuries
      BC).\r\n\r\nGenetic studies have pointed to multiple maternal origins in South
      Asia, Southeast Asia, and East Asia, but with the clade found in the Americas,
      Europe, the Middle East and Africa originating in the Indian subcontinent. From
      ancient India, the domesticated chicken spread to Lydia in western Asia Minor,
      and to Greece by the 5th century BC. Fowl had been known in Egypt since the
      mid-15th century BC, with the \"bird that gives birth every day\" having come
      to Egypt from the land between Syria and Shinar, Babylonia, according to the
      annals of Thutmose III."
    - https://www.themealdb.com/images/ingredients/Chicken.png
    - 2020-04-27 18:13:45.278785000 Z
    - 2020-04-27 18:13:45.278785000 Z
  - - 2
    - Salmon
    - "Salmon is the common name for several species of ray-finned fish in the family
      Salmonidae. Other fish in the same family include trout, char, grayling and
      whitefish. Salmon are native to tributaries of the North Atlantic (genus Salmo)
      and Pacific Ocean (genus Oncorhynchus). Many species of salmon have been introduced
      into non-native environments such as the Great Lakes of North America and Patagonia
      in South America. Salmon are intensively farmed in many parts of the world.\r\n\r\nTypically,
      salmon are anadromous: they hatch in fresh water, migrate to the ocean, then
      return to fresh water to reproduce. However, populations of several species
      are restricted to fresh water through their lives. Folklore has it that the
      fish return to the exact spot where they hatched to spawn. Tracking studies
      have shown this to be mostly true. A portion of a returning salmon run may stray
      and spawn in different freshwater systems; the percent of straying depends on
      the species of salmon. Homing behavior has been shown to depend on olfactory
      memory. Salmon date back to the Neogene."
    - https://www.themealdb.com/images/ingredients/Salmon.png
    - 2020-04-27 18:13:45.295530000 Z
    - 2020-04-27 18:13:45.295530000 Z
  - - 3
    - Beef
    - "Beef is the culinary name for meat from cattle, particularly skeletal muscle.
      Humans have been eating beef since prehistoric times. Beef is a source of high-quality
      protein and nutrients.\r\n\r\nMost beef skeletal muscle meat can be used as
      is by merely cutting into certain parts, such as roasts, short ribs or steak
      (filet mignon, sirloin steak, rump steak, rib steak, rib eye steak, hanger steak,
      etc.), while other cuts are processed (corned beef or beef jerky). Trimmings,
      on the other hand, are usually mixed with meat from older, leaner (therefore
      tougher) cattle, are ground, minced or used in sausages. The blood is used in
      some varieties called blood sausage. Other parts that are eaten include other
      muscles and offal, such as the oxtail, liver, tongue, tripe from the reticulum
      or rumen, glands (particularly the pancreas and thymus, referred to as sweetbread),
      the heart, the brain (although forbidden where there is a danger of bovine spongiform
      encephalopathy, BSE, commonly referred to as mad cow disease), the kidneys,
      and the tender testicles of the bull (known in the United States as calf fries,
      prairie oysters, or Rocky Mountain oysters). Some intestines are cooked and
      eaten as is, but are more often cleaned and used as natural sausage casings.
      The bones are used for making beef stock."
    - https://www.themealdb.com/images/ingredients/Beef.png
    - 2020-04-27 18:13:45.301295000 Z
    - 2020-04-27 18:13:45.301295000 Z
  - - 4
    - Pork
    - "Pork is the culinary name for the flesh of a domestic pig (Sus scrofa domesticus).
      It is the most commonly consumed meat worldwide,[1] with evidence of pig husbandry
      dating back to 5000 BC.\r\n\r\nPork is eaten both freshly cooked and preserved.
      Curing extends the shelf life of the pork products. Ham, smoked pork, gammon,
      bacon and sausage are examples of preserved pork. Charcuterie is the branch
      of cooking devoted to prepared meat products, many from pork.\r\n\r\nPig is
      the most popular meat in the Eastern and non-Muslim parts of Southeastern Asia
      (Indochina, Philippines, Singapore, East Timor) and is also very common in the
      Western world, especially in Central Europe. It is highly prized in Asian cuisines
      for its fat content and pleasant texture. Consumption of pork is forbidden by
      Jewish, Muslim and Rastafarian dietary law, for religious reasons, with several
      suggested possible causes."
    - https://www.themealdb.com/images/ingredients/Pork.png
    - 2020-04-27 18:13:45.325796000 Z
    - 2020-04-27 18:13:45.325796000 Z
  - - 5
    - Avocado
    - "The avocado, a tree with probable origin in South Central Mexico, is classified
      as a member of the flowering plant family Lauraceae. The fruit of the plant,
      also called an avocado (or avocado pear or alligator pear), is botanically a
      large berry containing a single large seed.\r\n\r\nAvocados are commercially
      valuable and are cultivated in tropical and Mediterranean climates throughout
      the world. They have a green-skinned, fleshy body that may be pear-shaped, egg-shaped,
      or spherical. Commercially, they ripen after harvesting. Avocado trees are partially
      self-pollinating, and are often propagated through grafting to maintain predictable
      fruit quality and quantity. In 2017, Mexico produced 34% of the world supply
      of avocados."
    - https://www.themealdb.com/images/ingredients/Avocado.png
    - 2020-04-27 18:13:45.329990000 Z
    - 2020-04-27 18:13:45.329990000 Z
  - - 6
    - Apple Cider Vinegar
    - Apple cider vinegar, or cider vinegar, is a vinegar made from fermented apple
      juice, and used in salad dressings, marinades, vinaigrettes, food preservatives,
      and chutneys. It is made by crushing apples, then squeezing out the juice. Bacteria
      and yeast are added to the liquid to start the alcoholic fermentation process,
      which converts the sugars to alcohol. In a second fermentation step, the alcohol
      is converted into vinegar by acetic acid-forming bacteria (Acetobacter species).
      Acetic acid and malic acid combine to give vinegar its sour taste. Apple cider
      vinegar has no medicinal or nutritional value. There is no high-quality clinical
      evidence that regular consumption of apple cider vinegar helps to maintain or
      lose body weight, or is effective to manage blood glucose and lipid levels.
    - https://www.themealdb.com/images/ingredients/Apple%20Cider%20Vinegar.png
    - 2020-04-27 18:13:45.333649000 Z
    - 2020-04-27 18:13:45.333649000 Z
  - - 7
    - Asparagus
    - "Asparagus, or garden asparagus, folk name sparrow grass, scientific name Asparagus
      officinalis, is a perennial flowering plant species in the genus Asparagus.
      Its young shoots are used as a spring vegetable.\r\n\r\nIt was once classified
      in the lily family, like the related Allium species, onions and garlic. However,
      genetic research places lilies, Allium, and asparagus in three separate families—the
      Liliaceae, Amaryllidaceae, and Asparagaceae, respectively—with the Amaryllidaceae
      and Asparagaceae being grouped together in the order Asparagales. Sources differ
      as to the native range of Asparagus officinalis, but generally include most
      of Europe and western temperate Asia. It is widely cultivated as a vegetable
      crop."
    - https://www.themealdb.com/images/ingredients/Asparagus.png
    - 2020-04-27 18:13:45.337081000 Z
    - 2020-04-27 18:13:45.337081000 Z
  - - 8
    - Aubergine
    - "Eggplant (US, Australia), aubergine (UK), or brinjal (South Asia and South
      Africa) is a plant species in the nightshade family Solanaceae. Solanum melongena
      is grown worldwide for its edible fruit.\r\n\r\nMost commonly purple, the spongy,
      absorbent fruit is used in various cuisines. Although often considered a vegetable,
      it is a berry by botanical definition. As a member of the genus Solanum, it
      is related to tomato and potato. Like the tomato, its skin and seeds can be
      eaten, but, like the potato, it is usually eaten cooked. Eggplant is nutritionally
      low in macronutrient and micronutrient content, but the capability of the fruit
      to absorb oils and flavors into its flesh through cooking expands its use in
      the culinary arts.\r\n\r\nIt was originally domesticated from the wild nightshade
      species thorn or bitter apple, S. incanum, probably with two independent domestications:
      one in South Asia, and one in East Asia."
    - https://www.themealdb.com/images/ingredients/Aubergine.png
    - 2020-04-27 18:13:45.447426000 Z
    - 2020-04-27 18:13:45.447426000 Z
  - - 9
    - Baby Plum Tomatoes
    - The tomato is the edible, often red, berry of the plant Solanum lycopersicum,
      commonly known as a tomato plant. The species originated in western South America
      and Central America. The Nahuatl (Aztec language) word tomatl gave rise to the
      Spanish word tomate, from which the English word tomato derived.[3][4] Its domestication
      and use as a cultivated food may have originated with the indigenous peoples
      of Mexico. The Aztecs used tomatoes in their cooking at the time of the Spanish
      conquest of the Aztec Empire, and after the Spanish encountered the tomato for
      the first time after their contact with the Aztecs, they brought the plant to
      Europe. From there, the tomato was introduced to other parts of the European-colonized
      world during the 16th century.
    - https://www.themealdb.com/images/ingredients/Baby%20Plum%20Tomatoes.png
    - 2020-04-27 18:13:45.482316000 Z
    - 2020-04-27 18:13:45.482316000 Z
  - - 10
    - Bacon
    - Bacon is a type of salt-cured pork. Bacon is prepared from several different
      cuts of meat, typically from the pork belly or from back cuts, which have less
      fat than the belly. It is eaten on its own, as a side dish (particularly in
      breakfasts), or used as a minor ingredient to flavour dishes (e.g., the club
      sandwich). Bacon is also used for barding and larding roasts, especially game,
      including venison and pheasant. The word is derived from the Old High German
      bacho, meaning "buttock", "ham" or "side of bacon", and is cognate with the
      Old French bacon.
    - https://www.themealdb.com/images/ingredients/Bacon.png
    - 2020-04-27 18:13:45.513445000 Z
    - 2020-04-27 18:13:45.513445000 Z
  - - 11
    - Baking Powder
    - Baking powder is a dry chemical leavening agent, a mixture of a carbonate or
      bicarbonate and a weak acid. The base and acid are prevented from reacting prematurely
      by the inclusion of a buffer such as cornstarch. Baking powder is used to increase
      the volume and lighten the texture of baked goods. It works by releasing carbon
      dioxide gas into a batter or dough through an acid-base reaction, causing bubbles
      in the wet mixture to expand and thus leavening the mixture. The first single-acting
      baking powder was developed by Birmingham based food manufacturer Alfred Bird
      in England in 1843. The first double-acting baking powder was developed by Eben
      Norton Horsford in America in the 1860s.
    - https://www.themealdb.com/images/ingredients/Baking%20Powder.png
    - 2020-04-27 18:13:45.521399000 Z
    - 2020-04-27 18:13:45.521399000 Z
