    - Biryani Masala
    - Biryani, also known as biriyani, biriani, birani or briyani, is a mixed rice
      dish with its origins among the Muslims of the Indian subcontinent. It can be
      compared to mixing a curry, later combining it with semi-cooked rice separately.
      This dish is especially popular throughout the Indian subcontinent, as well
      as among the diaspora from the region. It is also prepared in other regions
      such as Iraqi Kurdistan. It is made with Indian spices, rice, meat (chicken,
      goat, beef, lamb, prawn, or fish), vegetables or eggs.
    - https://www.themealdb.com/images/ingredients/Biryani%20Masala.png
