    - "Black pepper (Piper nigrum) is a flowering vine in the family Piperaceae, cultivated
      for its fruit, known as a peppercorn, which is usually dried and used as a spice
      and seasoning. When fresh and fully mature, it is about 5 mm (0.20 in) in diameter
      and dark red, and contains a single seed, like all drupes. Peppercorns and the
      ground pepper derived from them may be described simply as pepper, or more precisely
      as black pepper (cooked and dried unripe fruit), green pepper (dried unripe
      fruit), or white pepper (ripe fruit seeds).\r\n\r\nBlack pepper is native to
      present-day Kerala in Southwestern India, and is extensively cultivated there
      and elsewhere in tropical regions. Vietnam is the world's largest producer and
      exporter of pepper, producing 34% of the world's crop, as of 2013."
