  - - 484
    - Baby Aubergine
    - "Eggplant (Solanum melongena) or aubergine is a species of nightshade grown
      for its edible fruit. Eggplant is the common name in North America, Australia
      and New Zealand; in British English, it is aubergine, and in South Asia and
      South Africa, brinjal.\r\n\r\nThe fruit is widely used in cooking. As a member
      of the genus Solanum, it is related to the tomato and the potato. It was originally
      domesticated from the wild nightshade species, the thorn or bitter apple, S.
      incanum, probably with two independent domestications, one in South Asia and
      one in East Asia."
    - https://www.themealdb.com/images/ingredients/Baby%20Aubergine.png
    - 2020-04-27 18:13:47.419322000 Z
    - 2020-04-27 18:13:47.419322000 Z
  - - 485
    - Paella Rice
    - "Paella[a] is a Valencian rice dish that has ancient roots but its modern form
      originated in the mid-19th century in the area around Albufera lagoon on the
      east coast of Spain, adjacent to the city of Valencia. Many non-Spaniards view
      paella as Spain's national dish, but most Spaniards consider it to be a regional
      Valencian dish. Valencians, in turn, regard paella as one of their identifying
      symbols.\r\n\r\nTypes of paella include Valencian paella, vegetable paella (Spanish:
      paella de verduras), seafood paella (Spanish: paella de mariscos), and mixed
      paella (Spanish: paella mixta), among many others. Valencian paella is believed
      to be the original recipe and consists of white rice, green beans (bajoqueta
      and tavella), meat (chicken, duck and rabbit), white beans (garrofón), snails,
      and seasoning such as saffron and rosemary. Another very common but seasonal
      ingredient is artichokes. Seafood paella replaces meat with seafood and omits
      beans and green vegetables. Mixed paella is a free-style combination of meat
      from land animals, seafood, vegetables, and sometimes beans. Most paella chefs
      use bomba rice due to it being less likely to overcook, but Valencians tend
      to use a slightly stickier (and thus more susceptible to overcooking) variety
      known as Senia. All types of paellas use olive oil."
    - https://www.themealdb.com/images/ingredients/Paella%20Rice.png
    - 2020-04-27 18:13:47.423428000 Z
    - 2020-04-27 18:13:47.423428000 Z
  - - 486
    - Scotch Bonnet
    - "Scotch bonnet, also known as bonney peppers, or Caribbean red peppers, is a
      variety of chili pepper named for its resemblance to a tam o' shanter hat. Also
      called ata rodo by Yoruba speakers of Nigeria, it is found mainly in the Caribbean
      islands; it is also found in Guyana (where it is called the ball-of-fire pepper),
      the Maldives Islands (where it is called githeyo mirus), Panama (where it is
      called aji chombo) and West Africa. Most Scotch bonnets have a heat rating of
      100,000–350,000 Scoville units. For comparison, most jalapeño peppers have a
      heat rating of 2,500 to 8,000 on the Scoville scale. However, completely sweet
      varieties of Scotch bonnet are grown on some of the Caribbean islands, called
      cachucha peppers.\r\n\r\nThese peppers are used to flavour many different dishes
      and cuisines worldwide and are often used in hot sauces and condiments. The
      Scotch bonnet has a sweeter flavour and stouter shape, distinct from its habanero
      relative with which it is often confused, and gives jerk dishes (pork/chicken)
      and other Caribbean dishes their unique flavour. Scotch bonnets are mostly used
      in West African, Antiguan, Kittitian/Nevisian, Anguilan, Dominican, St. Lucian,
      St Vincentian, Grenadian, Trinidadian, Jamaican, Barbadian, Guyanese, Surinamese,
      Haitian and Cayman cuisines and pepper sauces, though they often show up in
      other Caribbean recipes. It is also used in Costa Rica and Panama for Caribbean-styled
      recipes such as rice and beans, Rondón, saus, beef patties, and Ceviche.\r\n\r\nFresh,
      ripe Scotch bonnets can change from green to yellow to scarlet red, however
      many other breeds of this pepper can ripen to orange, yellow, peach, or even
      a chocolate brown."
    - https://www.themealdb.com/images/ingredients/Scotch%20Bonnet.png
    - 2020-04-27 18:13:47.426600000 Z
    - 2020-04-27 18:13:47.426600000 Z
  - - 487
    - Oxtail
    - "Oxtail (occasionally spelled ox tail or ox-tail) is the culinary name for the
      tail of cattle. Formerly, it referred only to the tail of an ox or steer, a
      bullock (a castrated male).[citation needed] An oxtail typically weighs 2 to
      4 lbs. (1–1.8 kg) and is skinned and cut into short lengths for sale.\r\n\r\nOxtail
      is a bony, gelatin-rich meat, which is usually slow-cooked as a stew[1] or braised.
      It is a traditional stock base for a soup. Traditional preparations involve
      slow cooking, so some modern recipes take a shortcut using a pressure cooker.
      Oxtail is the main ingredient of the Italian dish coda alla vaccinara (a classic
      of Roman cuisine). It is a popular flavour for powder, instant and premade canned
      soups in the United Kingdom and Ireland. Oxtails are also one of the popular
      bases for Russian aspic appetizer dishes (холодец or студень), along with pig
      trotters or ears or cow \"knees\", but are the preferred ingredients among Russian
      Jews because they can be Kosher.\r\n\r\nVersions of oxtail soup are popular
      traditional dishes in South America, West Africa, China, Spain [2] and Indonesia.
      In Chinese cuisine, it's usually made into a soup called 牛尾汤 (niúwěi tāng, \"oxtail
      soup\"). In Korean cuisine, a soup made with oxtail is called kkori gomtang
      (see gomguk). It is a thick soup seasoned with salt and eaten with a bowl of
      rice. It can be used as a stock for making tteokguk (rice cake soup). Stewed
      oxtail with butter bean or as main dish (with rice) is popular in Jamaica, Trinidad,
      and other West Indian cultures. Oxtail is also very popular in South Africa
      where it is often cooked in a traditional skillet called a potjie, which is
      a three-legged cast iron pot placed over an open fire. Oxtail is also eaten
      in other southern parts of Africa like Zimbabwe and served with sadza and greens.
      In the United States, oxtail is a mainstay in African American and West Indian
      households. In Cuban cuisine, a stew can be made from oxtail called rabo encendido.
      In the Philippines, it is prepared in a peanut based stew called Kare-kare.
      In Iran, Oxtail is slow-cooked and served as a substitute for shank in a main
      dish called Baghla-Poli-Mahicheh which is prepared with rice, shank (or oxtail)
      and a mixture of herbs including dill, coriander, parsley and garlic.\r\n\r\nIn
      the United States, oxtail has the meat-cutting classification NAMP 1791."
    - https://www.themealdb.com/images/ingredients/Oxtail.png
    - 2020-04-27 18:13:47.438558000 Z
    - 2020-04-27 18:13:47.438558000 Z
