  - - 489
    - Red Snapper
    - "The northern red snapper (Lutjanus campechanus) is a species of snapper native
      to the western Atlantic Ocean including the Gulf of Mexico, where it inhabits
      environments associated with reefs. This species is commercially important and
      is also sought-after as a game fish.\r\n\r\nThe northern red snapper's body
      is very similar in shape to other snappers, such as the mangrove snapper, mutton
      snapper, lane snapper, and dog snapper. All feature a sloped profile, medium-to-large
      scales, a spiny dorsal fin, and a laterally compressed body. Northern red snapper
      have short, sharp, needle-like teeth, but they lack the prominent upper canine
      teeth found on the mutton, dog, and mangrove snappers. This snapper reaches
      maturity at a length of about 39 cm (15 in). The common adult length is 60 cm
      (24 in), but may reach 100 cm (39 in). The maximum published weight is 38 kg
      (84 lb), and the oldest reported age is 100+ years. Coloration of the northern
      red snapper is light red, with more intense pigment on the back. It has 10 dorsal
      spines, 14 soft dorsal rays, three anal spines and eight to 9 anal soft rays.
      Juvenile fish (shorter than 30–35 cm) can also have a dark spot on their sides,
      below the anterior soft dorsal rays, which fades with age."
    - https://www.themealdb.com/images/ingredients/Red%20Snapper.png
    - 2020-04-27 18:13:47.445929000 Z
    - 2020-04-27 18:13:47.445929000 Z
  - - 490
    - Malt Vinegar
    - "Vinegar is a liquid consisting of about 5–20% acetic acid (CH3COOH), water,
      and other trace chemicals, which may include flavorings. The acetic acid is
      produced by the fermentation of ethanol by acetic acid bacteria. Vinegar is
      now mainly used as a cooking ingredient, or in pickling. As the most easily
      manufactured mild acid, it has historically had a great variety of industrial,
      medical, and domestic uses, some of which (such as its use as a general household
      cleaner) are still commonly practiced today.\r\n\r\nCommercial vinegar is produced
      either by a fast or a slow fermentation process. In general, slow methods are
      used in traditional vinegars where fermentation proceeds slowly over the course
      of a few months or up to a year. The longer fermentation period allows for the
      accumulation of a non-toxic slime composed of acetic acid bacteria. Fast methods
      add mother of vinegar (bacterial culture) to the source liquid before adding
      air to oxygenate and promote the fastest fermentation. In fast production processes,
      vinegar may be produced between 20 hours to three days."
    - https://www.themealdb.com/images/ingredients/Malt%20Vinegar.png
    - 2020-04-27 18:13:47.456433000 Z
    - 2020-04-27 18:13:47.456433000 Z
  - - 491
    - Rice Vinegar
    - "Rice vinegar is a vinegar made from fermented rice in China, Japan, Korea,
      and Vietnam.\r\n\r\nChinese rice vinegars are stronger than Japanese ones, and
      range in colour from clear to various shades of red, brown and black and are
      therefore known as rice wine vinegar. Chinese and especially Japanese vinegars
      are less acidic than the distilled Western vinegars which, for that reason,
      are not appropriate substitutes for rice vinegars. The majority of the Asian
      rice vinegar types are also more mild and sweet than vinegars typically used
      in the Western world, with black vinegars as a notable exception. Chinese rice
      vinegars are made from huangjiu, a type of rice wine."
    - https://www.themealdb.com/images/ingredients/Rice%20Vinegar.png
    - 2020-04-27 18:13:47.459182000 Z
    - 2020-04-27 18:13:47.459182000 Z
  - - 492
    - Water Chestnut
    - "Eleocharis dulcis, the Chinese water chestnut or water chestnut, is a grass-like
      sedge native to Asia (China, Japan, India, Philippines, etc.), Australia, tropical
      Africa, and various islands of the Pacific and Indian Oceans. It is grown in
      many countries for its edible corms.\r\n\r\nThe water chestnut is not a nut
      at all, but an aquatic vegetable that grows in marshes, under water, in the
      mud. It has stem-like, tubular green leaves that grow to about 1.5 m. The water
      caltrop, which also is referred to by the same name, is unrelated and often
      confused with the water chestnut.\r\n\r\nThe small, rounded corms have a crisp,
      white flesh and may be eaten raw, slightly boiled, or grilled, and often are
      pickled or tinned. They are a popular ingredient in Chinese dishes. In China,
      they are most often eaten raw, sometimes sweetened. They also may be ground
      into a flour form used for making water chestnut cake, which is common as part
      of dim sum cuisine. They are unusual among vegetables for remaining crisp even
      after being cooked or canned, because their cell walls are cross-linked and
      strengthened by certain phenolic compounds, such as oligomers of ferulic acid.
      This property is shared by other vegetables that remain crisp in this manner,
      including the tiger nut and lotus root. The corms contain the antibiotic agent
      puchiin, which is stable to high temperature. Apart from the edible corms, the
      leaves can be used for cattlefeed, mulch or compost.\r\n\r\nThe corms are rich
      in carbohydrates (about 90% by dry weight), especially starch (about 60% by
      dry weight), and are also a good source of dietary fiber, riboflavin, vitamin
      B6, potassium, copper, and manganese.\r\n\r\nIf eaten uncooked, the surface
      of the plants may transmit fasciolopsiasis."
    - https://www.themealdb.com/images/ingredients/Water%20Chestnut.png
