  - - 493
    - Tofu
    - "Tofu, also known as bean curd, is a food cultivated by coagulating soy milk
      and then pressing the resulting curds into soft white blocks. It is a component
      in East Asian and Southeast Asian cuisines. Tofu can be soft, firm, or extra
      firm. Tofu has a subtle flavor and can be used in savory and sweet dishes. It
      is often seasoned or marinated to suit the dish.\r\n\r\nTofu has a low calorie
      count and relatively large amounts of protein. It is high in iron, and it can
      have a high calcium or magnesium content, depending on the coagulants used in
      manufacturing (e.g. calcium chloride, calcium sulfate, magnesium sulfate)."
    - https://www.themealdb.com/images/ingredients/Tofu.png
