  - - 494
    - Doubanjiang
    - "Doubanjiang (IPA: [tôupântɕjâŋ]), or simply Douban, or Toban-djan, Chili
      bean sauce, is a spicy, salty paste made from fermented broad beans, soybeans,
      salt, rice, and various spices. Doubanjiang exists in plain and spicy versions,
      with the latter containing red chili peppers and called la doubanjiang (辣豆瓣酱;
      pinyin: là dòubànjiàng; là meaning \"hot\" or \"spicy\").\r\n\r\nIt is used
      particularly in Sichuan cuisine, and in fact, the people of the province commonly
      refer to it as \"the soul of Sichuan cuisine\". A particularly well-known variety
      is called Pixian Douban (simplified Chinese: 郫县豆瓣; traditional Chinese: 郫縣豆瓣;
      pinyin: Píxiàn dòubàn), named after the district of Pixian, Sichuan.[1]\r\n\r\nThis
      sauce is sometimes stir-fried with oil and eaten with rice or noodles as a quick
      meal, and is also commonly used as a primary flavoring for fried tofu dishes
      and cold tofu salads. It is also frequently mixed with instant noodles.\r\n\r\nIn
      many Chinese communities and food factories, doubanjiang is produced with only
      soybeans and salt, and does not contain the broad beans or chili peppers typical
      of Sichuan-style doubanjiang.\r\n\r\nIn Korean cuisine, a similar form of bean
      paste is called doenjang."
    - https://www.themealdb.com/images/ingredients/Doubanjiang.png
    - 2020-04-27 18:13:47.476041000 Z
    - 2020-04-27 18:13:47.476041000 Z
  - - 495
    - Fermented Black Beans
    - "Douchi (Chinese: 豆豉; pinyin: dòuchǐ), or tochi is a type of fermented and salted
      black soybean. In English, it is known as fermented black soybeans, Chinese
      fermented black beans (Chinese: 黑豆豆豉; pinyin: hēidòu dòuchǐ), salted black beans,
      salty black beans, or just black beans. They are a flavoring most popular in
      the cuisine of China, where they are most widely used for making black bean
      sauce dishes.[1][page needed]\r\n\r\nDouchi is made by fermenting and salting
      black soybeans. The black type soybean is most commonly used and the process
      turns the beans soft, and mostly semi-dry (if the beans are allowed to dry).
      Regular soybeans (white soybeans) are also used, but this does not produce \"salted
      black beans\"; instead, these beans become brown. The smell is sharp, pungent,
      and spicy; the taste is salty, somewhat bitter and sweet.[citation needed] The
      product made with white soybeans is called mianchi.\r\n\r\nThe process and product
      are similar to ogiri and iru, both being African fermented bean products[citation
      needed].\r\n\r\nDouchi, \"Chinese salted black beans\", and \"black soybeans\"
      should not be confused with the black turtle bean, a variety of common bean
      that is commonly used in the cuisines of Central America, South America, and
      the Caribbean."
    - https://www.themealdb.com/images/ingredients/Fermented%20Black%20Beans.png
