  - - 497
    - Sichuan Pepper
    - "Sichuan pepper, Sichuan peppercorn, or Szechuan pepper, is a commonly used
      spice in Chinese cuisine. It is derived from at least two species of the global
      genus Zanthoxylum, including Z. simulans and Z. bungeanum. The genus Zanthoxylum
      belongs in the rue or citrus family, and, despite its name, is not closely related
      to either black pepper nor the chili pepper.\r\n\r\nThe husk or hull (pericarp)
      around the seeds may be used whole, especially in Sichuan cuisine, and the finely
      ground powder is one of the ingredients for five-spice powder. It is also used
      in traditional Chinese medicine. The pericarp is most often used, but the leaves
      of various species are also used in some regions of China.\r\n\r\nAnother species
      of Zanthoxylum native to China, Z. schinifolium, called xiāng jiāo zi (香椒子,
      \"aromatic peppercorn\") or qīng huā jiāo (青花椒, \"green flower pepper\"), is
      used as a spice in Hebei.\r\n\r\nWhile the exact flavour and composition of
      different species from the genus Zanthoxylum vary, most share the same essential
      characteristics. So while the terms \"Sichuan pepper\" and sanshō may refer
      specifically to Z. simulans and Z. piperitum, respectively, the two are commonly
      used interchangeably.\r\n\r\nRelated species are used in the cuisines of Tibet,
      Bhutan, Nepal, Thailand, and India (the Konkani and Uttarakhandi people) and
      Toba Batak peoples. In Bhutan, this pepper is known as thingye and is used liberally
      in preparation of soups, gruels, and phaag sha paa (pork slices).[citation needed]
      In Nepal, timur is used in the popular foods momo, thukpa, chow mein, chicken
      chilli, and other meat dishes. It is also widely used in homemade pickles. People
      take timur as a medicine for stomach or digestion problems, in a preparation
      with cloves of garlic and mountain salt with warm water."
    - https://www.themealdb.com/images/ingredients/Sichuan%20Pepper.png
