  - - 499
    - Starch
    - "Starch or amylum is a polymeric carbohydrate consisting of a large number of
      glucose units joined by glycosidic bonds. This polysaccharide is produced by
      most green plants as energy storage. It is the most common carbohydrate in human
      diets and is contained in large amounts in staple foods like potatoes, wheat,
      maize (corn), rice, and cassava.\r\n\r\nPure starch is a white, tasteless and
      odorless powder that is insoluble in cold water or alcohol. It consists of two
      types of molecules: the linear and helical amylose and the branched amylopectin.
      Depending on the plant, starch generally contains 20 to 25% amylose and 75 to
      80% amylopectin by weight.[4] Glycogen, the glucose store of animals, is a more
      highly branched version of amylopectin.\r\n\r\nIn industry, starch is converted
      into sugars, for example by malting, and fermented to produce ethanol in the
      manufacture of beer, whisky and biofuel. It is processed to produce many of
      the sugars used in processed foods. Mixing most starches in warm water produces
      a paste, such as wheatpaste, which can be used as a thickening, stiffening or
      gluing agent. The biggest industrial non-food use of starch is as an adhesive
      in the papermaking process. Starch can be applied to parts of some garments
      before ironing, to stiffen them."
    - https://www.themealdb.com/images/ingredients/Starch.png
    - 2020-04-27 18:13:47.524147000 Z
    - 2020-04-27 18:13:47.524147000 Z
  - - 500
    - Rice wine
    - "Rice wine is an alcoholic beverage fermented and distilled from rice, traditionally
      consumed in East Asia, Southeast Asia and South Asia. Rice wine is made from
      the fermentation of rice starch that has been converted to sugars. Microbes
      are the source of the enzymes that convert the starches to sugar.[1]\r\n\r\nRice
      wine typically has an alcohol content of 18–25% ABV. Rice wines are used in
      Asian gastronomy at formal dinners and banquets and in cooking. They are also
      used in a religious and ceremonial context."
    - https://www.themealdb.com/images/ingredients/Rice%20wine.png
