  - - 506
    - Wood Ear Mushrooms
    - "Auricularia auricula-judae, known as the Jew's ear, wood ear, jelly ear or
      by a number of other common names, is a species of edible Auriculariales fungus
      found worldwide. The fruiting body is distinguished by its noticeably ear-like
      shape and brown colouration; it grows upon wood, especially elder. Its specific
      epithet is derived from the belief that Judas Iscariot hanged himself from an
      elder tree; the common name \"Judas's ear\" was largely eclipsed by the corruption
      \"Jew's ear\", while today \"jelly ear\" and other names are sometimes used.
      The fungus can be found throughout the year in temperate regions worldwide,
      where it grows upon both dead and living wood.\r\n\r\nIn the West, A. auricula-judae
      was used in folk medicine as recently as the 19th century for complaints including
      sore throats, sore eyes and jaundice, and as an astringent. Although it is not
      widely consumed in the West, it has long been popular in China, to the extent
      that Australia exported large volumes to China in the early twentieth century.
      Today, the fungus is a popular ingredient in many Chinese dishes, such as hot
      and sour soup, and also used in Chinese medicine. It is also used in Ghana,
      as a blood tonic. Modern research into possible medical applications has variously
      concluded that A. auricula-judae has antitumour, hypoglycemic, anticoagulant
      and cholesterol-lowering properties."
    - https://www.themealdb.com/images/ingredients/Wood%20Ear%20Mushrooms.png
    - 2020-04-27 18:13:47.556255000 Z
    - 2020-04-27 18:13:47.556255000 Z
  - - 507
    - Dark Rum
    - "Rum is a distilled alcoholic drink made from sugarcane byproducts, such as
      molasses, or directly from sugarcane juice, by a process of fermentation and
      distillation. The distillate, a clear liquid, is then usually aged in oak barrels.\r\n\r\nThe
      majority of the world's rum production occurs in the Caribbean and Latin America.
      Rum is also produced in Australia, Portugal, Austria, Canada, Fiji, India, Japan,
      Mauritius, Nepal, New Zealand, the Philippines, Reunion Island, South Africa,
      Spain, Sweden, Taiwan, Thailand, the United Kingdom and the United States.\r\n\r\nRums
      are produced in various grades. Light rums are commonly used in cocktails, whereas
      \"golden\" and \"dark\" rums were typically consumed straight or neat, on the
      rocks, or used for cooking, but are now commonly consumed with mixers. Premium
      rums are also available, made to be consumed either straight or iced.\r\n\r\nRum
      plays a part in the culture of most islands of the West Indies as well as in
      The Maritimes and Newfoundland. This drink has famous associations with the
      Royal Navy (where it was mixed with water or beer to make grog) and piracy (where
      it was consumed as bumbo). Rum has also served as a popular medium of economic
      exchange, used to help fund enterprises such as slavery (see Triangular trade),
      organized crime, and military insurgencies (e.g., the American Revolution and
      Australia's Rum Rebellion)."
    - https://www.themealdb.com/images/ingredients/Dark%20Rum.png
    - 2020-04-27 18:13:47.558758000 Z
    - 2020-04-27 18:13:47.558758000 Z
