  - - 519
    - Almond Extract
    - "The almond (Prunus dulcis, syn. Prunus amygdalus) is a species of tree native
      to Mediterranean climate regions of the Middle East, but widely cultivated elsewhere.
      The almond is also the name of the edible and widely cultivated seed of this
      tree. Within the genus Prunus, it is classified with the peach in the subgenus
      Amygdalus, distinguished from the other subgenera by corrugations on the shell
      (endocarp) surrounding the seed.\r\n\r\nThe fruit of the almond is a drupe,
      consisting of an outer hull and a hard shell with the seed, which is not a true
      nut, inside. Shelling almonds refers to removing the shell to reveal the seed.
      Almonds are sold shelled or unshelled. Blanched almonds are shelled almonds
      that have been treated with hot water to soften the seedcoat, which is then
