  - - 524
    - Ras el hanout
    - "Ras el hanout or rass el hanout (Arabic: راس الحانوت‎ raʾs al-ḥānūt, pronounced
      [rɑʔs ælħɑːnuːt] (About this soundlisten)) is a spice mix found in varying forms
      in Tunisia, Algeria, and Morocco.[1] It plays a similar role in North African
      cuisine as garam masala does in Indian cuisine. The name in Arabic means \"head
      of the shop\" and implies a mixture of the best spices the seller has to offer.
      Ras el hanout is used in many savory dishes, sometimes rubbed on meat or fish,
      or stirred into couscous or rice.\r\n\r\nThere is no definitive composition
      of spices that makes up ras el hanout. Each shop, company, or family may have
      their own blend. The mixture usually consists of over a dozen spices, in different
      proportions. Commonly used ingredients include cardamom, cumin, clove, cinnamon,
      nutmeg, mace, allspice, dry ginger, chili peppers, coriander seed, peppercorn,
      sweet and hot paprika, fenugreek, and dry turmeric. Some spices may be particular
      to the region, such as ash berries, chufa, grains of paradise, orris root, monk's
      pepper, cubebs, dried rosebud, fennel seed or aniseed, galangal, long pepper.
      Ingredients may be toasted before being ground or pounded in a mortar and mixed
      together. Some preparations include salt or sugar, but that is generally not
      the accepted practice. Garlic, saffron, nuts or dry herbs are generally not
      included, as they are usually added to dishes individually, but some commercial
      preparations, particularly in Europe and North America, may contain them.\r\n\r\nThe
      composition of ras el hanout differs somewhat from the Baharat spice mix, but
      they differ more by the types of dishes they are associated with and by region
      rather than the ingredients in them. Although used by Berber people, it should
      not be confused with \"berbere\" spice mix from Ethiopia.\r\n\r\nCertain supposed
      aphrodisiacs, including the notoriously dangerous \"green metallic beetles\",
      cantharides, have appeared in many Moroccan prescriptions, but these seem to
      be irrelevant for flavouring purposes."
    - https://www.themealdb.com/images/ingredients/Ras%20el%20hanout.png
