      casserole dish once it is browned all over. Add extra oil if the pan seems dry.\r\nIn
      the same pan, add another tablespoon of oil and cook the shallots for 4-5 minutes,
      then add the garlic and fry for 30 seconds. Add the bacon and fry until slightly
      browned. Transfer the onion and bacon mixture to the casserole dish and add
