      frying pan and bring to the boil, stirring to lift any stuck-on browned bits
      from the bottom of the pan. Pour the stout over the beef in the casserole dish
      and add the stock. Cover the casserole and place it in the oven for 1½-2 hours,
      or until the beef is tender and the sauce is reduced.\r\nSkim off any surface
      fat, taste and add salt and pepper if necessary, then stir in the cornflour
      paste. Put the casserole dish on the hob – don’t forget that it will be hot
      – and simmer for 1-2 minutes, stirring, until thickened. Leave to cool.\r\nIncrease
      the oven to 200C/400F/Gas 6. To make the pastry, put the flour and salt in a
      very large bowl. Grate the butter and stir it into the flour in three batches.
      Gradually add 325ml/11fl oz cold water – you may not need it all – and stir
      with a round-bladed knife until the mixture just comes together. Knead the pastry
      lightly into a ball on a lightly floured surface and set aside 250g/9oz for
      the pie lid.\r\nRoll the rest of the pastry out until about 2cm/¾in larger than
