      keep for a week in the fridge, or it can be frozen for up to six weeks.\L\r\n\r\nOn
      Christmas Day, boil or oven steam for 1 hr. Unwrap and turn out. To flame, warm
      3-4 tbsp brandy in a small pan, pour it over the pudding and set light to it."
