    - "This is one recipe a lot of people have requested and I have tried to make
      it as simple as possible and I hope it will work for you. Make sure you use
      the right flour which is basically one with raising agents. Adjust the amount
      of sugar to your taste and try using different flavours to have variety whenever
      you have them.\r\nYou can use Coconut milk instead of regular milk, you can
      also add desiccated coconut to the dry flour or other spices like powdered cloves
      or cinnamon.\r\nFor “healthy looking” mandazis do not roll the dough too thin
      before frying and use the procedure I have indicated above.\r\n\r\n1. Mix the
      flour,cinnamon and sugar in a suitable bowl.\r\n2. In a separate bowl whisk
      the egg into the milk\r\n3. Make a well at the centre of the flour and add the
      milk and egg mixture and slowly mix to form a dough.\r\n4. Knead the dough for
      3-4 minutes or until it stops sticking to the sides of the bowl and you have
      a smooth surface.\r\n5. Cover the dough with a damp cloth  and allow to rest
