      and butter it.\r\nTip butter, flour and vanilla seeds into a food processor;
      pulse until the butter has disappeared. Tip into a mixing bowl. Stir through
      the suet, pour in the milk and work together with a cutlery knife until you
      get a sticky dough. You may need a drop more milk, depending on your flour.\r\nTip
      the dough out onto a floured surface, quickly pat together to smooth, then roll
      out to a square roughly 25 x 25cm. Spread the jam all over, leaving a gap along
      one edge, then roll up from the opposite edge. Pinch the jam-free edge into
      the dough where it meets, and pinch the ends roughly, too. Carefully lift onto
      the greased paper, join-side down (you might find a flat baking sheet helpful
