      the minced lamb, white pepper, fresh coriander, and the cooled spiced onion
      mixture until combined. Set aside, covered, in the fridge.\r\nPreheat the oven
      to 200C/400F/Gas 6 and generously grease a 20cm/8in diameter loose-bottomed
      or springform round cake tin with lard.\r\nTo make the pastry, sift the flour
      and salt in a large bowl and make a well in the centre.\r\nPut the milk, lard
      and 90ml/3fl oz of water in a saucepan and heat gently. When the lard has melted,
      increase the heat and bring to the boil.\r\nPour the boiling liquid into the
      flour, and use a wooden spoon to combine until cool enough to handle. Bring
      together into a ball.\r\nDust a work surface with flour and, working quickly,
      knead the dough briefly – it will be soft and moist. Set aside a third of the
      pastry and roll the rest out on a well-floured surface. Line the pie dish with
      the pastry, pressing it right up the sides until it pokes just over the top
      of the tin.\r\nAdd the filling into the pastry-lined tin bit by bit. As you
      reach the top, form a slight peak. Roll out the reserved pastry and top the
      pie with it. Pinch the edges to seal and trim the excess. Poke a hole in the
      top of the pie and insert a small tube made from aluminium foil to allow steam
      to escape.\r\nBrush the top of the pie with a little beaten egg yolk, and bake
      in the preheated oven for 30 minutes (put a tray on the shelf below to catch
      any drips). Then reduce the temperature to 160C/325F/Gas 3 and cook for a further
      1¼ hours until golden-brown. Leave to cool completely before refrigerating for
      two hours, or overnight.\r\nRun a knife around the edge of the pie, remove from
      the tin and serve with chutneys, salads or pickles."
