      the base with a fork, to stop the base rising up during baking.\r\nPlace the
      reserved pastry for the lattice top on cling film and roll out thinly. Egg wash
      the pastry and set aside to chill in the fridge (the cling film makes it easier
      to move about). Do not cut into strips at this stage. Do not egg wash the strips
      once they are on the tart as it will drip into the treacle mixture.\r\nTo make
      the filling, heat the syrup gently in a large pan but do not boil.\r\nOnce melted,
      add the breadcrumbs, lemon juice and zest to the syrup. (You can add less lemon
