      wash the edge of the pastry in the tin, and start to make the woven laying lattice
      pattern over the mixture, leave the strips hanging over the edge of the tin.\r\nOnce
      the lattice is in place, use the tin edge to cut off the strips by pressing
      down with your hands, creating a neat finish.\r\nBake on the pre-heated baking
      tray in the hot oven for about 10 minutes until the pastry has started to colour,
      and then reduce the oven temperature to 180C/350F/Gas 4. If at this stage the
