      transfer the sauce to a large bowl and stir in the mustard powder, cayenne pepper,
      Gruyère and egg yolks until fully combined.\r\nIn a spotlessly clean bowl and
      with a clean whisk, beat the egg whites just until peaks begin to form.\r\nCarefully
      fold the egg whites into the cheese sauce in three stages making sure you fold,
      rather than stir, to keep the egg whites light and airy. Fill the prepared ramekins
      with the soufflé mix.\r\nTop each soufflé with a slice of goat’s cheese, then
      place on a baking tray. Bake for 20-25 minutes or until springy and well risen
      but cooked through.\r\nLeave to cool, then run a knife around the edge of each
      dish and remove the soufflés. If preparing in advance, place soufflés upside
      down (for neat presentation), on a tray. Cover tray in cling film. Chill for
      a few days or freeze for up to 1 month.\r\nWhen ready to re-bake, heat oven
      to 200C/180C fan/gas 6. Place the upside-down soufflés in a shallow baking dish,
      top with the remaining goat’s cheese slices and pour over the cream (this stops
      them from drying out when baked for the second time). Cook for 8-10 minutes
      until golden. Serve immediately alongside some simply dressed salad."
